import Expenseitem from "./Expenseitem";
import App from "../App";

const ExpenseTask = (props) => {
  return ( 
    <div>
      <Expenseitem thatDay={pr[0].thatDay} title={pr[0].title} rate={pr[0].rate} />
      <Expenseitem thatDay={pr[1].thatDay} title={pr[1].title} rate={pr[1].rate}/>
      <Expenseitem thatDay={pr[2].thatDay} title={pr[2].title} rate={pr[2].rate}/>
      <Expenseitem thatDay={pr[3].thatDay} title={pr[3].title} rate={pr[3].rate}/>
      <Expenseitem thatDay={pr[4].thatDay} title={pr[4].title} rate={pr[4].rate}/>
    </div>
   );
}
 
export default ExpenseTask;
